// GetPreflopEquity returns the equity for a hand category and opponent count
func GetPreflopEquity(category string, opponents int) float64 {
	equities, ok := PreflopEquityData[category]
	if !ok || opponents < 1 || opponents > 9 {
		return 0.0
	}
	return equities[opponents-1]
}
